  false,\n\t\"url\": null,\n\t\"notes\": \"The continued grazing of cattle on grasslands
  and marsh acquired by the Prime Hook National Wildlife Refuge will be designed to
  retard the development of undesirable ground cover including brush and hardwood
  reproduction. Grazing may be introduced in certain areas to open up dense marsh
  and enhance wildlife objectives. This plan details those areas of the refuge that
  are being considered for cattle grazing and outlines the possible outcomes. This
  plan also includes a copy of the Soil and Moisture Plan from 1967.\",\n\t\"license_title\":
